import React, { useState } from "react";
import { ClipLoader } from "react-spinners";

function App() {
    const [file, setFile] = useState();
    const [loading, setLoading] = useState(false);
    function handleChange(e) {
        console.log(e.target.files);
        setFile(URL.createObjectURL(e.target.files[0]));
    }
    const onPredictClick = (e) => {
      setLoading(!loading)
    }
    const override = {
      display: "block",
      margin: "0 auto",
      borderColor: "red",
    };

    return (
        <div className="App">
            <h2 id='title'>Breast Cancer Prediction:</h2>
            <input type="file" onChange={handleChange} id='input-box'/>
            <img src={file} id='preview'/>
            <button className="submit-button" onClick={onPredictClick}>Predict</button>
            <ClipLoader color="#000000" loading={loading} size={150} aria-label="Loading Spinner" cssOverride={override} />
        </div>

    );
}

export default App;
